1925-1989 was another jazz musician whose subtle influence on the genre is not immideately apparent due to his obscurity, but still formidable due to his great esteem by the musicians of the genre.  Before moving to Scandanavia, converting to Islam and changing his name, Shihab had a career as a sideman in American, working with Coltrane and Phil Woods among others..  In Europe, he worked with the Frances Boland-Kenny Clarke Band for many years while etching out a sizeable following throughout the continent.

